// third
const canvas = document.getElementById("canvas1")
const ctx = canvas.getContext("2d")
canvas.width = window.innerWidth
canvas.height = window.innerHeight
let particleArray = []
let adjustX = 11
let adjustY = -5

// handle mouse

const mouse = {
    x: null,
    y: null,
    radius: 50
}

window.addEventListener("mousemove", function (event){
    mouse.x = event.x
    mouse.y = event.y
    console.log(mouse.x, mouse.y)
})

ctx.fillStyle = "white"
ctx.font = "12px Verdana"
ctx.fillText("DIPLOMA", 0, 30)
// ctx.strokeStyle = "white"
// ctx.strokeRect = (0, 0, 100, 100)
const textCoordinates = ctx.getImageData(0, 0, 100, 100)

class Particle {
    constructor(x, y) {
        this.x = x
        this.y = y
        this.size = 3
        this.baseX = this.x
        this.baseY = this.y
        this.destiny = (Math.random() * 40) + 5
    }
    draw(){
        ctx.fillStyle = "white"
        ctx.beginPath()
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2)
        ctx.closePath()
        ctx.fill()
    }
    update(){
        let dx = mouse.x - this.x
        let dy = mouse.y - this.y
        let distance = Math.sqrt(dx * dx + dy * dy)
        let forceDirectionX = dx / distance
        let forceDirectionY = dy / distance
        let maxDistance =  mouse.radius
        let force = (maxDistance - distance) / maxDistance
        let directionX = forceDirectionX * force * this.destiny
        let directionY = forceDirectionY * force * this.destiny

        if(distance < mouse.radius){
            this.x -= directionX
            this.y -= directionY
        } else{
            if(this.x !== this.baseX){
                let dx = this.x - this.baseX
                this.x -= dx/10
            }
            if(this.y !== this.baseY){
                let dy = this.y - this.baseY
                this.y -= dy/10
            }
        }
    }
}

console.log(textCoordinates.data)
function init(){
    particleArray = []
    for (let y = 0, y2 = textCoordinates.height; y < y2; y++){
        for (let x = 0, x2 = textCoordinates.width; x < x2; x++){
            if (textCoordinates.data[(y * 4 * textCoordinates.width) + (x * 4) + 3] > 128){
                let positionX = x + adjustX
                let positionY = y + adjustY
                particleArray.push(new Particle(positionX * 20, positionY * 20))
            }
        }
    }
    // for(let i = 0; i < 1000; i++){
    //     let x = Math.random() * canvas.width
    //     let y = Math.random() * canvas.height
    //     particleArray.push(new Particle(x, y))
    // }
    // particleArray.push(new Particle(50, 200))
    // particleArray.push(new Particle(80, 300))
}
init()
console.log(particleArray)

function animate(){
    ctx.clearRect(0, 0, canvas.width, canvas.height)
    for(let i = 0; i < particleArray.length; i++){
        particleArray[i].draw()
        particleArray[i].update()
    }
    connect()
    requestAnimationFrame(animate)
}
animate()

function connect(){
    let opacityValue = 1
    for (let a = 0; a < particleArray.length; a++){
        for (let b = a; b < particleArray.length; b++){
            // let dx = mouse.x - this.x
            // let dy = mouse.y - this.y
            // let distance = Math.sqrt(dx * dx + dy * dy)
            let dx = particleArray[a].x - particleArray[b].x
            let dy= particleArray[a].y - particleArray[b].y
            let distance = Math.sqrt(dx * dx + dy * dy)

            opacityValue = 1 - (distance/40)
            ctx.strokeStyle = "rgba(255, 255, 255," + opacityValue + ")"

            if (distance < 40){

                ctx.lineWidth = 2
                ctx.beginPath()
                ctx.moveTo(particleArray[a].x, particleArray[a].y)
                ctx.lineTo(particleArray[b].x, particleArray[b].y)
                ctx.stroke()
            }
        }
    }
}


